import './Vasarlas.css'
import bookielogo from '../assets/bookielogo.png'

function Vasarlas() {

    function Generate() {
        var idk
        for (var i = 0; i < 5; i++) {
            idk += (<div class="termekek">
                <div class="termek">
                    <div><img src={bookielogo} alt="" /></div>
                    <div><span>Chill guy</span></div>
                    <div><span>100</span> <span>0.5 km</span></div>
                </div>
            </div>)
        }
        return idk
    }


    var idk = [{
        logo: bookielogo
    },{
        Name: "semmi"
    },{
        Price: 100
    },{
        Distance: "0.5km"
    }]
    for (var i = 0; i < 5; i++) {
        idk.push(idk)
    }
    console.log(idk)

    return (
        <div class="content">
            <div class="sort">
                <span>Könyv címe: </span>
                <input type="text" />
                <input type="checkbox" name="Csere" id="" /><span>Csere</span>
                <select name="" id="">
                    <option value="">Legolcsóbb</option>
                    <option value="">Legdrágább</option>
                    <option value="">Legközelebb</option>
                    <option value="">Legújabb</option>
                    <option value="">Legrégebbi</option>
                </select>
                <span>Szerző neve: </span>
                <input type="text" />
            </div>
            <div class="termekek">
                {idk.map(idkk=>{
                <div class="termek">
                    <div><img src={idkk.logo} alt="" /></div>
                    <div><span>Chill guy</span></div>
                    <div><span>100</span> <span>0.5 km</span></div>
                </div>
                })}
            </div>
            
        </div>
    )
}

export default Vasarlas
